    .directions({
      params: {
        origin: "13.7244416,100.3529157",
        destination: "Bangkok",
        mode: "driving",
        key: apiKey
      },
      timeout: 1000 // milliseconds
    })
    .then(r => {
      // console.log(r.data.results[0].elevation);
      console.log(r.data.results);
      res.json({
        data: r.data.results
      })
    })
    .catch(e => {
      console.log(e);
      res.json({
        data: e
      })
    });
}

